import React, {Component} from 'react';
import './css/App.css';
import bg from "./bg.jpg";
import Home from "./content/Home";
import Navbar from "./components/Navbar";
import Events from "./content/Events";

const page_content = [
    {id: "home",    component: <Home/>      },
    {id: "events",  component: <Events/>    },
    {id: "km",      component: <Home/>      },
    {id: "contact", component: <Home/>      },
    {id: "login",   component: <Home/>      }
];

const default_page_content = <Home/>;

class App extends Component {
    data = {
        current_page: "home"
    };

    render() {
        const content = (page_content[this.data.current_page] !== undefined)
            ? page_content[this.data.current_page]
            : default_page_content;

        return (
            <div className="App">
                <img src={bg} id={"bg"} alt={"Background"}/>
                <Navbar/>
                { content }
            </div>
        )
    }
}

export default App;
